/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `SYS_MENU_INFO` (
  `MENU_ID` varchar(50) NOT NULL,
  `MENU_NAME` varchar(50) NOT NULL DEFAULT '' COMMENT '菜单名称',
  `PARENT_MENU_CODE` varchar(50) NOT NULL DEFAULT '' COMMENT '上级菜单',
  `MENU_ICON` varchar(50) NOT NULL DEFAULT '' COMMENT '图标.(参见layui2.x图标即可)',
  `MENU_TYPE` int NOT NULL DEFAULT '1' COMMENT '菜单类型. 1代表目录。2和3代表菜单。4代表按钮.(最大支持3级菜单)',
  `SORT` int NOT NULL DEFAULT '0' COMMENT '排序',
  `MENU_CODE` varchar(50) NOT NULL DEFAULT '' COMMENT '菜单英文标识',
  `MENU_URL` varchar(255) NOT NULL DEFAULT '' COMMENT '菜单地址',
  `AUTHORIZATION` varchar(255) NOT NULL DEFAULT '' COMMENT '授权标识。多个之间用逗号隔开',
  `DISABLE` int NOT NULL DEFAULT '0' COMMENT '状态.1代表正常。0代表已删除',
  PRIMARY KEY (`MENU_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='菜单权限表';
