DROP TABLE IF EXISTS `SYS_USER_OPERATION_LOG`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `SYS_USER_OPERATION_LOG` (
  `ID` varchar(50) NOT NULL,
  `USER_NAME` varchar(50) NOT NULL DEFAULT '' COMMENT '用户名',
  `OPERATION_MODULE` varchar(255) NOT NULL DEFAULT '' COMMENT '操作模块',
  `OPERATION_TYPE` varchar(255) NOT NULL DEFAULT '' COMMENT '操作类型',
  `VISIT_METHOD` varchar(255) NOT NULL DEFAULT '' COMMENT '请求方法',
  `PARAMETERS` varchar(255) NOT NULL DEFAULT '' COMMENT '请求参数',
  `IP_ADDRESS` varchar(255) NOT NULL DEFAULT '' COMMENT 'IP地址',
  `DURATION` int NOT NULL DEFAULT '0' COMMENT '执行时长',
  `OPERATION_TIME` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '操作时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='用户操作日志表';
