-- Table structure for table `tb_contract`
--

DROP TABLE IF EXISTS `tb_contract`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tb_contract` (
  `id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin NOT NULL,
  `cust_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL COMMENT '客户id',
  `contract_name` varchar(255) DEFAULT NULL COMMENT '合同名称',
  `contract_code` varchar(255) DEFAULT NULL COMMENT '合同编码',
  `amounts` int DEFAULT NULL COMMENT '合同金额',
  `start_date` date DEFAULT NULL COMMENT '合同生效开始时间',
  `end_date` date DEFAULT NULL COMMENT '合同生效结束时间',
  `content` longtext COMMENT '合同内容',
  `affix_seal_status` int DEFAULT '0' COMMENT '是否盖章确认 0 否 1 是',
  `audit_status` int DEFAULT '0' COMMENT '审核状态 0 未审核 1 审核通过 -1 审核不通过',
  `nullify_status` int DEFAULT '0' COMMENT '是否作废 1 作废 0 在用',
  `input_user` varchar(50) DEFAULT NULL COMMENT '录入人',
  `input_time` datetime DEFAULT NULL COMMENT '录入时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `tb_contract_tb_customer_id_fk` (`cust_id`),
  KEY `tb_contract_SYS_USER_INFO_USER_ID_fk` (`input_user`),
  CONSTRAINT `tb_contract_SYS_USER_INFO_USER_ID_fk` FOREIGN KEY (`input_user`) REFERENCES `SYS_USER_INFO` (`USER_ID`),
  CONSTRAINT `tb_contract_tb_customer_id_fk` FOREIGN KEY (`cust_id`) REFERENCES `tb_customer` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='合同信息';
/*!40101 SET character_set_client = @saved_cs_client */;

